import { NavLink } from "react-router-dom";

function Header() {
    return (
        <div className="header-container">
            <NavLink to="/">
                <div className="nav-element">element</div>
            </NavLink>
            <NavLink to="/prognoza">
                <div className="nav-element">element</div>
            </NavLink>
            <NavLink to="/ulubione-miasta">
                <div className="nav-element">element</div>
            </NavLink>
        </div>
    );
}

export default Header;
